@test integrate((c*e+d*e*x)^-1*(a+b*arctanh(c+d*x)), x) == :(a*d^-1*e^-1*log(c+d*x)+(1/2)*b*d^-1*e^-1*Polylogarithms.polylog(2,c+d*x)+-1//2*b*d^-1*e^-1*Polylogarithms.polylog(2,-1c+-1*d*x))
@test integrate((c*e+d*e*x)^-2*(a+b*arctanh(c+d*x)), x) == :(b*d^-1*e^-2*log(c+d*x)+-1*d^-1*e^-2*(c+d*x)^-1*(a+b*arctanh(c+d*x))+-1//2*b*d^-1*e^-2*log(1+-1*(c+d*x)^2))
@test integrate((c*e+d*e*x)^-3*(a+b*arctanh(c+d*x)), x) == :((1/2)*b*d^-1*e^-3*arctanh(c+d*x)+-1//2*b*d^-1*e^-3*(c+d*x)^-1+-1//2*d^-1*e^-3*(c+d*x)^-2*(a+b*arctanh(c+d*x)))
@test integrate((a+b*arctanh(c+d*x))^2*(c*e+d*e*x)^3, x) == :(-1//4*d^-1*e^3*(a+b*arctanh(c+d*x))^2+(1/2)*a*b*x*e^3+1//3*b^2*d^-1*e^3*log(1+-1*(c+d*x)^2)+1//4*d^-1*e^3*(a+b*arctanh(c+d*x))^2*(c+d*x)^4+1//12*b^2*d^-1*e^3*(c+d*x)^2+(1/2)*b^2*d^-1*e^3*(c+d*x)*arctanh(c+d*x)+1//6*b*d^-1*e^3*(c+d*x)^3*(a+b*arctanh(c+d*x)))
@test integrate((a+b*arctanh(c+d*x))^2*(c*e+d*e*x)^2, x) == :(1//3*x*b^2*e^2+1//3*d^-1*e^2*(a+b*arctanh(c+d*x))^2+-1//3*b^2*d^-1*e^2*Polylogarithms.polylog(2,-1*(1+-1c+-1*d*x)^-1*(1+c+d*x))+-1//3*b^2*d^-1*e^2*arctanh(c+d*x)+1//3*d^-1*e^2*(a+b*arctanh(c+d*x))^2*(c+d*x)^3+-2//3*b*d^-1*e^2*(a+b*arctanh(c+d*x))*log(2*(1+-1c+-1*d*x)^-1)+1//3*b*d^-1*e^2*(c+d*x)^2*(a+b*arctanh(c+d*x)))
